- input: "TEXT\x1CC00019331\x1CX0\x1C\x1CF3XN\x1C(1) Payroll-related items on Schedules
    H4 and/or H6 of this report were for employees that spent 25% or less of their
    compensated time on Federal activity. (2) Any receipts on lines 15 or 17 were
    assessed at the usual and normal charge. (3) Any fundraising expenses on line
    21b were for the benefit of the committee and did not support a federal candidate.
    (4) Receipts on Schedule A supporting line 11c from unregistered committees Friends
    for Roger Anclam for Assembly, Friends of David Cullen, Friends of Julie Lassa,
    and Hintz for Assembly have been deemed permissible. These contributions were
    made by non-Federal candidates that had the required funds from Federally-permissible
    sources. The funds were verified to have come from permissible sources and no
    amount exceeded the $1,000 threshold that would require the committees to register
    with the Commission. (5) This report includes memoed Schedule A entries for contributions
    raised by the DSP State Victory Fund joint fundraising program. The committee
    has received part of its share of the proceeds as of the end of the reporting
    period, and expects to receive its remaining share during the next three reporting
    periods. (6) This report adjusts debts reported on line 10 to Liberty Concepts.
    The vendor had been billing the committee off of the same invoice over a period
    of several months, and some of the reported debts contained duplicate charges.
